import React from "react";
import { ReactDOM } from "react";

const dataObat:React.FC = () => {

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>No</th>
            <th>Nama</th>
            <th>Jumlah</th>
            <th>Harga</th>
          </tr>
        </thead>
      </table>
    </div>
  )
}

export default dataObat;
